import React, { useState } from "react";
import Item from "./Item";

const stateChange = (number) => {
   number += 100;
   console.log(number);
};

const App = () => {
   let number = 100;
   useState(number);

   return (
      <div>
         <Item number="100"></Item>
      </div>
   );
};

export default App;
